import React from "react";
import "./App.css";
import "./bootstrap/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <div className="main">
        <div className="choose">
          <form className="form">
            <input placeholder="Link: " />
          </form>
        </div>
      </div>
    </div>
  );
}

export default App;
